int main()
{
	int m, o, r, c, h, a;

	scanf("%d%d", &n, &m);
	for (r = 0; r < n; r++) for (c = 0; c < n; c++) scanf("%d", &a), map[r][c] = a;
	while (m-- > 0) {
		scanf("%d", &o);
		if (o == 0) {  // rotate
			scanf("%d%d%d%d", &r, &c, &h, &a);
			rotate(r-1, c-1, h, a);
		} else if (o == 1) {
			scanf("%d%d%d", &r, &c, &h);
			reverse(r-1, c-1, h);
		} else if (o == 2) {
			scanf("%d", &r);
			shift(r-1, 1);
		} else if (o == 3) {
			scanf("%d", &r);
			shift(r-1, 0);
		} else {
			scanf("%d%d", &r, &c);
			islandRev(r-1, c-1);
		}
	}
	for (r = 0; r < n; r++) {
		printf("%d", map[r][0]);
		for (c = 1; c < n; c++) printf(" %d", map[r][c]);
		putchar('\n');
	}
	return 0;
}
